import React from 'react';
import {
  Box,
  Typography,
  TextField,
  Button,
  Grid,
  IconButton,
  InputAdornment,
  Snackbar,
  Alert,
  LinearProgress
} from '@mui/material';
import BadgeIcon from '@mui/icons-material/Badge';
import VisibilityIcon from '@mui/icons-material/Visibility';
import VisibilityOffIcon from '@mui/icons-material/VisibilityOff';
import { useNavigate } from 'react-router-dom';

export default function RegisterForm({ onClose, onRegisterSuccess }) {
  const navigate = useNavigate();
  const [mostrarClave, setMostrarClave] = React.useState(false);
  const [formData, setFormData] = React.useState({
    nombre: '',
    apellido: '',
    correo: '',
    telefono: '',
    documento: '',
    contraseña: '',
    confirmar: ''
  });
  const [errores, setErrores] = React.useState({});
  const [registroExitoso, setRegistroExitoso] = React.useState(false);

  const validar = () => {
    const newErrors = {};
    const correoRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    const telRegex = /^[0-9]{7,}$/;

    if (!formData.nombre.trim()) newErrors.nombre = 'El nombre es obligatorio.';
    if (!formData.apellido.trim()) newErrors.apellido = 'El apellido es obligatorio.';
    if (!formData.correo || !correoRegex.test(formData.correo)) newErrors.correo = 'Ingrese un correo electrónico válido.';
    if (!formData.telefono || !telRegex.test(formData.telefono)) newErrors.telefono = 'Ingrese un número de teléfono válido.';
    if (!formData.documento.trim()) newErrors.documento = 'Debe especificar tipo y número de documento.';
    if (!formData.contraseña || formData.contraseña.length < 6) newErrors.contraseña = 'La contraseña debe tener al menos 6 caracteres.';
    if (formData.confirmar !== formData.contraseña) newErrors.confirmar = 'Las contraseñas no coinciden.';

    setErrores(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const evaluarFortaleza = (clave) => {
    if (clave.length >= 10 && /[A-Z]/.test(clave) && /\d/.test(clave)) return 100;
    if (clave.length >= 8 && /\d/.test(clave)) return 60;
    if (clave.length >= 6) return 30;
    return 10;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (validar()) {
      console.log('Datos registrados:', formData);
      setRegistroExitoso(true);
      setTimeout(() => navigate('/comprar'), 2000);
      if (onRegisterSuccess) onRegisterSuccess();
      if (onClose) onClose();
    }
  };

  return (
    <Box component="form" onSubmit={handleSubmit} noValidate sx={{ display: 'flex', flexDirection: 'column', gap: 2, p: 2 }}>
      <Typography variant="h5" sx={{ fontWeight: 'bold', color: 'white', bgcolor: 'primary.main', p: 2, borderRadius: 2, textAlign: 'center' }}>
        Registro de Usuario
      </Typography>

      <Typography variant="subtitle1" sx={{ fontWeight: 'bold', mt: 3, mb: 1 }}>Datos Personales</Typography>
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6}>
          <TextField
            label="Nombre"
            name="nombre"
            fullWidth
            value={formData.nombre}
            onChange={(e) => setFormData({ ...formData, nombre: e.target.value })}
            error={!!errores.nombre}
            helperText={errores.nombre}
            InputLabelProps={{ shrink: true }}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            label="Apellido"
            name="apellido"
            fullWidth
            value={formData.apellido}
            onChange={(e) => setFormData({ ...formData, apellido: e.target.value })}
            error={!!errores.apellido}
            helperText={errores.apellido}
            InputLabelProps={{ shrink: true }}
          />
        </Grid>
      </Grid>

      <Typography variant="subtitle1" sx={{ fontWeight: 'bold', mt: 3, mb: 1 }}>Información de Contacto</Typography>
      <TextField
        label="Correo Electrónico"
        name="correo"
        type="email"
        fullWidth
        autoComplete="email"
        value={formData.correo}
        onChange={(e) => setFormData({ ...formData, correo: e.target.value })}
        error={!!errores.correo}
        helperText={errores.correo}
        InputLabelProps={{ shrink: true }}
      />
      <TextField
        label="Teléfono"
        name="telefono"
        type="tel"
        fullWidth
        autoComplete="tel"
        value={formData.telefono}
        onChange={(e) => setFormData({ ...formData, telefono: e.target.value })}
        error={!!errores.telefono}
        helperText={errores.telefono}
        InputLabelProps={{ shrink: true }}
      />
      <TextField
        label="Tipo y Número de Documento"
        name="documento"
        fullWidth
        value={formData.documento}
        onChange={(e) => setFormData({ ...formData, documento: e.target.value })}
        error={!!errores.documento}
        helperText={errores.documento}
        InputLabelProps={{ shrink: true }}
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <BadgeIcon sx={{ color: '#666' }} />
            </InputAdornment>
          )
        }}
      />

      <Typography variant="subtitle1" sx={{ fontWeight: 'bold', mt: 3, mb: 1 }}>Credenciales de Acceso</Typography>
      <TextField
        label="Contraseña"
        name="contraseña"
        type={mostrarClave ? 'text' : 'password'}
        fullWidth
        autoComplete="new-password"
        value={formData.contraseña}
        onChange={(e) => setFormData({ ...formData, contraseña: e.target.value })}
        error={!!errores.contraseña}
        helperText={errores.contraseña || 'Debe contener al menos 6 caracteres.'}
        InputLabelProps={{ shrink: true }}
        InputProps={{
          endAdornment: (
            <InputAdornment position="end">
              <IconButton onClick={() => setMostrarClave(!mostrarClave)} edge="end">
                {mostrarClave ? <VisibilityOffIcon /> : <VisibilityIcon />}
              </IconButton>
            </InputAdornment>
          )
        }}
      />
      <LinearProgress variant="determinate" value={evaluarFortaleza(formData.contraseña)} sx={{ height: 8, borderRadius: 5 }} />

      <TextField
        label="Confirmar Contraseña"
        name="confirmar"
        type="password"
        fullWidth
        autoComplete="new-password"
        value={formData.confirmar}
        onChange={(e) => setFormData({ ...formData, confirmar: e.target.value })}
        error={!!errores.confirmar}
        helperText={errores.confirmar}
        InputLabelProps={{ shrink: true }}
      />

      <Box sx={{ display: 'flex', gap: 2, mt: 3 }}>
        <Button type="submit" variant="contained" fullWidth color="success" sx={{ fontWeight: 'bold' }}>
          Crear cuenta
        </Button>
        <Button onClick={onClose} variant="outlined" fullWidth>
          Cancelar
        </Button>
      </Box>

      <Snackbar
        open={registroExitoso}
        autoHideDuration={4000}
        onClose={() => setRegistroExitoso(false)}
        anchorOrigin={{ vertical: 'top', horizontal: 'center' }}
      >
        <Alert severity="success" variant="filled" onClose={() => setRegistroExitoso(false)}>
          Registro completado exitosamente. Redirigiendo...
        </Alert>
      </Snackbar>
    </Box>
  );
}
